import requests

from .common import *

def findRegionChina(adcode):
    if (adcode == 100000):
        return {
            'province': None,
            'city': None,
            'district': None
        }
    if (adcode == 419001):
        return {
            'province': '河南省',
            'city': '焦作市',
            'district': '济源市'
        }

    # 假如后两位不是0，则到区一级
    if (adcode - int(adcode / int(100)) * 100 > 0):
        district = adcodeChina[adcode]
    else:
        district = None

    # 加入中间两位不是0，则到市一级
    if (adcode - int(adcode / int(10000)) * 10000 > 0):
        city = adcodeChina[int(adcode / int(100)) * 100]
    else:
        city = None

    # 省一级
    province = adcodeChina[int(adcode / int(10000)) * 10000]
    
    return {
        'province': province,
        'city': city,
        'district': district
    }

def findAdcodeChina(province: str = None, city: str = None, district: str = None): 
    if (province == None and city == None and district == None):
        return 100000

    # 济源市咋这么特殊
    if (district == "济源市"):
        return 419001

    abcode = None
    foundFlag = False

    # 前两位
    p = 0
    if (province != None):
        foundFlag = False
        for i in adcodeChina:
            if (adcodeChina[i] == province):
                p = int(i / int(10000))
                foundFlag = True
    m = 0
    if (city != None and province != None):
        foundFlag = False
        for i in adcodeChina:
            if (adcodeChina[i] == city):
                pTmp = int(i / int(10000))
                if (pTmp == p):
                    m = int(i / int(100)) - p * 100
                    foundFlag = True
    l = 0
    if (district != None and city != None and province != None):
        foundFlag = False
        for i in adcodeChina:
            if (adcodeChina[i] == district):
                pTmp = int(i / int(10000))
                if (pTmp == p):
                    mTmp = int(i / int(100)) - p * 100
                    if (mTmp == m):
                        l = i - p * 10000 - m * 100
                        foundFlag = True
    if (foundFlag):
        abcode = p * 10000 + m * 100 + l
    else:
        raise UnsupportedInputError("Error: Cannot find %s, %s, %s." % (province, city, district)) 

    return abcode

def findPolysChina(
    province: str = None,
    city: str = None,
    district: str = None, 
    readFromLocalFlag: bool = True,
    localDirectory: str = "D:/Zoo/gull/geoVeRoPy/data/map",
    saveToLocalFlag: bool = True):

    multiPoly = []
    adcode = findAdcodeChina(province, city, district)
    foundInLocal = False
    # 先尝试一下本地有没有暂存下来的文件，如果没有，就新建一个
    if (readFromLocalFlag):
        try:
            shape = loadDictionary(localDirectory)
            if (adcode in shape):
                for f in shape[adcode]['features']:
                    if (f['geometry']['type'] == 'MultiPolygon'):
                        multiPoly.extend(f['geometry']['coordinates'])
                    elif (f['geometry']['type'] == 'Polygon'):
                        multiPoly.append(f['geometry']['coordinates'])
                foundInLocal = True
        except:
            pass
    if (not foundInLocal):
        # 注意，回来的是lon, lat的形式
        url = "https://geo.datav.aliyun.com/areas_v3/bound/%s.json" % adcode
        response = requests.get(url=url)

        # 如果搜索到
        if (response.status_code == 200):
            if (saveToLocalFlag):
                shape = {}
                try:
                    shape = loadDictionary(localDirectory)
                    shape[adcode] = response.json()
                    saveDictionary(shape, localDirectory)
                except:
                    pass
            for f in response.json()['features']:
                if (f['geometry']['type'] == 'MultiPolygon'):
                    multiPoly.extend(f['geometry']['coordinates'])
                elif (f['geometry']['type'] == 'Polygon'):
                    multiPoly.append(f['geometry']['coordinates'])

    # 把lon/lat翻转一下
    for polys in multiPoly:
        for poly in polys:
            for pt in poly:
                pt[0], pt[1] = pt[1], pt[0]

    return multiPoly

